glsl3.vert:
precision highp float;
layout(std140) uniform CCGlobal {
  highp   vec4 cc_time;
  mediump vec4 cc_screenSize;
  mediump vec4 cc_nativeSize;
  mediump vec4 cc_probeInfo;
  mediump vec4 cc_debug_view_mode;
};
layout(std140) uniform CCCamera {
  highp   mat4 cc_matView;
  highp   mat4 cc_matViewInv;
  highp   mat4 cc_matProj;
  highp   mat4 cc_matProjInv;
  highp   mat4 cc_matViewProj;
  highp   mat4 cc_matViewProjInv;
  highp   vec4 cc_cameraPos;
  mediump vec4 cc_surfaceTransform;
  mediump vec4 cc_screenScale;
  mediump vec4 cc_exposure;
  mediump vec4 cc_mainLitDir;
  mediump vec4 cc_mainLitColor;
  mediump vec4 cc_ambientSky;
  mediump vec4 cc_ambientGround;
  mediump vec4 cc_fogColor;
  mediump vec4 cc_fogBase;
  mediump vec4 cc_fogAdd;
  mediump vec4 cc_nearFar;
  mediump vec4 cc_viewPort;
};
#if USE_LOCAL
  layout(std140) uniform CCLocal {
    highp mat4 cc_matWorld;
    highp mat4 cc_matWorldIT;
    highp vec4 cc_lightingMapUVParam;
    highp vec4 cc_localShadowBias;
    highp vec4 cc_reflectionProbeData1;
    highp vec4 cc_reflectionProbeData2;
    highp vec4 cc_reflectionProbeBlendData1;
    highp vec4 cc_reflectionProbeBlendData2;
  };
#endif
in vec3 a_position;
in vec2 a_texCoord;
in vec4 a_color;
out vec4 v_color;
out vec2 v_uv0;
#if USE_TEXTURE
  in vec2 a_uv0;
#endif
vec4 vert (){
  vec4 pos = vec4(a_position, 1);
  #if USE_LOCAL
    pos = cc_matWorld * pos;
  #endif
  #if USE_PIXEL_ALIGNMENT
    pos = cc_matView * pos;
    pos.xyz = floor(pos.xyz);
    pos = cc_matProj * pos;
  #else
    pos = cc_matViewProj * pos;
  #endif
  #if USE_TEXTURE
    v_uv0 = a_uv0;
  #endif
  v_color = a_color;
  v_uv0 = a_texCoord;
  return pos;
}
void main() { gl_Position = vert(); }

glsl3.frag:
precision highp float;
vec4 CCSampleWithAlphaSeparated(sampler2D tex, vec2 uv) {
#if CC_USE_EMBEDDED_ALPHA
  return vec4(texture(tex, uv).rgb, texture(tex, uv + vec2(0.0, 0.5)).r);
#else
  return texture(tex, uv);
#endif
}
#if USE_ALPHA_TEST
  layout(std140) uniform ALPHA_TEST_DATA {
    float alphaThreshold;
  };
#endif
in vec4 v_color;
#if USE_TEXTURE
  in vec2 v_uv0;
  uniform sampler2D cc_spriteTexture;
#endif
uniform sampler2D noiceTx;
#if SHOW_INNER_GLOW
  layout(std140) uniform glow {
    float hitwhit;
    float glowThreshold;
  };
#endif
vec4 frag () {
  vec4 o = vec4(1, 1, 1, 1);
  vec4 white = vec4(1 , 1 ,1, 1);
  vec4 burnColor = vec4(0, 0, 0.8, 1);
  float vcolorA = v_color.a;
  #if USE_TEXTURE
    o *= CCSampleWithAlphaSeparated(cc_spriteTexture, v_uv0);
    #if IS_GRAY
      float gray  = 0.2126 * o.r + 0.7152 * o.g + 0.0722 * o.b;
      o.r = o.g = o.b = gray;
    #endif
    #if CC_USE_ALPHA_ATLAS_TEXTURE
      o.a *= texture2D(cc_spriteTexture, v_uv0 + vec2(0, 0.5)).r;
    #endif
  #endif
  #if SHOW_INNER_GLOW
    vec4 color_dest = o;
    if(hitwhit > 0.){
      if(color_dest.a > 0.02 ){
        o = white * hitwhit + color_dest;
      }else{
        o = color_dest;
      }
    }
    vec4 innerLightParam = vec4(1,1,1,1);
    innerLightParam.r = o.a;
    innerLightParam.g = 1. - abs(v_uv0.x - 0.5) * 0.5 ;
    innerLightParam.b = 1. - abs(v_uv0.y - 0.5) * 0.5 ;
    innerLightParam.a = innerLightParam.g * innerLightParam.b * 0.8;
    if(innerLightParam.r < 0.08){
        innerLightParam.a = 0.;
    }
    vec4 color_src = burnColor * innerLightParam.a;
    if(v_color.r < 0.1){
      o = color_src * color_src.a + color_dest;
    }
  #endif
   vec3 result = mix(white.rgb, o.rgb,vcolorA);
  o = vec4(result.rgb, o.a);
  if(v_color.g != 1.){
    float disFactor = 1.0;
    disFactor *= step(o.b,v_color.g) * step(o.r, v_color.g) * step(o.g,v_color.g);
    if(disFactor == 1.){
      discard;
    }
    disFactor = 1.0;
    disFactor *= step(v_color.g,0.2) * step(o.b,v_color.g+0.2);
    o.rgb = mix(o.rgb, vec3(.2,.6,.2), disFactor);
  }
  return o;
}
layout(location = 0) out vec4 cc_FragColor;
void main() { cc_FragColor = frag(); }
